import React, { useState } from 'react'
import { Container, Nav, Navbar, NavDropdown } from 'react-bootstrap'
import StaticSunBurst from '../buildCharts/sunBurstChart/StaticSunBurst'
import BoxPlot from '../charts/BoxPlot'
import StaticBoxPlot from '../buildCharts/boxPlotChart/StaticBoxPlot'
import WordCloud from '../charts/WordCloud'
import StaticWordCloud from '../buildCharts/wordCloudChart/StaticWordCloud'
import StaticStackedBar from '../buildCharts/stackedBarChart/StaticStackedBar'
import StaticTimeLine from '../buildCharts/timeLineChart/StaticTimeLine'

const ChooseCharts = ({ title, showChart, showTimeline }) => {
  const [activeChart, setActiveChart] = useState('')
  const [boxPlotData, setBoxPlotData] = useState({})
  const [wordCloudData, setWordCloudData] = useState({})
  const [timeLineData, setTimeLineData] = useState({})
  const [sunburstData, setSunburstData] = useState({})
  const [sunburstLabel, setSunburstLabel] = useState({})
  const [eventTypeColor, setEventTypeColor] = useState({})

  const handleDataReceived = (data) => {
    setBoxPlotData(data)
  }

  const handleWordDataReceived = (data) => {
    setWordCloudData(data)
  }

  const handleTimeLineDataReceived = (data) => {
    setTimeLineData(data)
  }

  const handleEventTypeColor = (data) => {
    setEventTypeColor(data)
  }

  const handleSunburstDataReceived = (data) => {
    setSunburstData(data)
  }

  const handleSunburstLabelReceived = (data) => {
    setSunburstLabel(data)
  }

  const renderActiveChart = () => {
    if (activeChart) {
      return sunburstLabel ? (
        <StaticSunBurst
          timeLabel={sunburstLabel}
          data={sunburstData}
          onDataReceived={handleDataReceived}
          onWordDataReceived={handleWordDataReceived}
          onTimeLineDataReceived={handleTimeLineDataReceived}
          onEventTypeColor={handleEventTypeColor}
        />
      ) : (
        <StaticSunBurst
          onDataReceived={handleDataReceived}
          onWordDataReceived={handleWordDataReceived}
          onTimeLineDataReceived={handleTimeLineDataReceived}
          onEventTypeColor={handleEventTypeColor}
        />
      )
    } else if (activeChart === 'BoxPlot') {
      return boxPlotData && Object.keys(boxPlotData).length > 0 ? (
        <BoxPlot data={boxPlotData} />
      ) : (
        <StaticBoxPlot />
      )
    } else if (activeChart === 'WordCloud') {
      return wordCloudData && wordCloudData.length > 0 ? (
        <WordCloud data={wordCloudData} />
      ) : (
        <StaticWordCloud />
      )
    } else if (activeChart === 'StackedBarChart') {
      return <StaticStackedBar />
    } else if (activeChart === 'TimeLineChar') {
      return timeLineData && timeLineData.length > 0 ? (
        <StaticTimeLine
          data={timeLineData}
          onDataReceived={handleDataReceived}
          onWordDataReceived={handleWordDataReceived}
          onExpLabelReceived={handleSunburstLabelReceived}
          onExpDataReceived={handleSunburstDataReceived}
          onEventTypeColor={eventTypeColor}
        />
      ) : (
        <StaticTimeLine
          onEventTypeColor={eventTypeColor}
          onDataReceived={handleDataReceived}
          onExpLabelReceived={handleSunburstLabelReceived}
          onExpDataReceived={handleSunburstDataReceived}
          onWordDataReceived={handleWordDataReceived}
        />
      )
    } else {
      return null
    }
  }

  return (
    <div>
      <Navbar expand="lg" className={'custom-navbar'}>
        <Container fluid>
          <Navbar.Brand href="#home">{title}</Navbar.Brand>
          <Navbar.Toggle aria-controls="navbar-dark-example" />
          <Navbar.Collapse id="navbar-dark-example">
            <Nav className="ms-auto">
              <NavDropdown
                id="nav-dropdown-dark-example"
                title="Choose a Chart"
                onSelect={(eventKey) => setActiveChart(eventKey)}
              >
                {showChart && (
                  <>
                    <NavDropdown.Item eventKey="SunBurst">
                      SunBurst
                    </NavDropdown.Item>
                    <NavDropdown.Item eventKey="BoxPlot">
                      BoxPlot
                    </NavDropdown.Item>
                    <NavDropdown.Item eventKey="WordCloud">
                      WordCloud
                    </NavDropdown.Item>
                    <NavDropdown.Item eventKey="StackedBarChart">
                      StackedBarChart
                    </NavDropdown.Item>
                  </>
                )}
                {showTimeline && (
                  <NavDropdown.Item eventKey="TimeLineChar">
                    TimeLine
                  </NavDropdown.Item>
                )}
              </NavDropdown>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
      <div className="chart-container">{renderActiveChart()}</div>
    </div>
  )
}

export default ChooseCharts
